import React from 'react';

export default function Main(props) {
    let items = props.items
    
    let listItems = items.map((item) => {
                    let number = items.indexOf(item)
                    return(
                        <div className='list-item'>
                            <li >{item}</li>

                            <div className='select-cont'>
                                <div 
                                onClick={(e) => props.onActive(e, 'one')} 
                                className={props.active.started ? 'select red' : 'select'}
                                /> 
                                <div 
                                onClick={(e) => props.onActive(e, 'two')} 
                                className={props.active.finish ? 'select blue' : 'select'}
                                /> 
                                <div 
                                onClick={(e) => props.onActive(e, 'three')} 
                                className={props.active.complete ? 'select green' : 'select'}
                                />  
                            </div>                            
                        </div>                    
                    )
                    
                })

    return(
                
            <ul className='main-cont'>
                {listItems.length > 0 ? listItems : []}
            </ul>
        
    )
}
